import { useForm } from "react-hook-form";
import "./AddProduct.css";

function AddProduct(): JSX.Element {

    useForm()


    return (
        <div className="AddProduct Box">


            <form>

                <h2>Add product</h2>

                <label>Name: </label>
                <input type="text" />

                <label>Price: </label>
                <input type="number" step="0.01" />

                 <label>Stock: </label>
                <input type="number" />

                <button>Add</button>

            </form>

        </div>
    );
}

export default AddProduct;
